import React from 'react'
import './style.css'

const Home = () => {
    const url = 'http://hp-api.herokuapp.com/api/characters'

    function getData(){

        fetch(url)
        .then(resp => resp.json())
        .then(data => {
            console.log(data)
            return(
                <div>{data.name}</div>
            )
        })
    }

    return(
        <div>
            {getData}
        </div>
    )
}

export default Home
